<h2>概念</h2>
<p>Kubernetes是一个容器编排框架，提供了一个<strong>可弹性运行分布式系统</strong>的框架</p>
<p>它具有以下功能：</p>
<ul>
<li><strong>服务发现和负载均衡</strong></li>
<li><strong>存储编排</strong></li>
<li><strong>自动部署和回滚</strong></li>
